    const formatNumber = (inputNumber) => {
        // Convierte el número a una cadena y revierte los caracteres
        const reversedNumberString = String(inputNumber).split('').reverse().join('');

        // Divide la cadena en grupos de 3 caracteres
        const groups = reversedNumberString.match(/.{1,3}/g);

        // Une los grupos con un punto y revierte nuevamente
        const formattedString = groups.join('.').split('').reverse().join('');

        // Actualiza el estado local
        return formattedString + ' €';
    };

    const handleSelectChange = (e) => {
